import { Animation } from "./game/animation";
import { context as ctx } from "./info/display";
import { bird, img as imgInfo, canvas as canvasInfo } from "./info/config";
import { deg2Rad } from "./util/utils";

export class Bird {
  constructor(x = 0, y = 0) {
    this.x = x
    this.y = y
    this.vy = 0
    this.g = bird.jumpG
    this.rotationAngle = 0
    this.initStatus = false
    this.init()
  }

  init() {
    let imgsPath = [
      'data:image/png;base64,',
      'data:image/png;base64,',
      'data:image/png;base64,'
    ]

    this.img = new Animation(imgsPath)

    this.img.imgsObj[0].onload = () => {
      this.w = this.img.imgsObj[0].width / imgInfo.imgsRatio
      this.h = this.img.imgsObj[0].height / imgInfo.imgsRatio
      this.initStatus = true
    }
  }

  jump() {
    this.vy = bird.jumpSpeed
    this.rotate(-45)
  }

  rotate(angle) {
    if (angle !== undefined) {
      this.rotationAngle = angle

      return
    }

    this.rotationAngle += 1.4

    if (this.rotationAngle > 90) {
      this.rotationAngle = 90
    }
  }

  update() {
    this.y += this.vy
    this.vy += this.g

    if (this.y + this.h > canvasInfo.canvasHeight - 64) {
      this.y = canvasInfo.canvasHeight - 64 - this.h
    }

    if (this.y <= 0) {
      this.y = 0
    }

    this.rotate()
  }

  draw(x = this.x, y = this.y) {
    ctx.save()

    ctx.translate(x + this.w / 2, y + this.h / 2)
    ctx.rotate(deg2Rad(this.rotationAngle))
    ctx.translate(-this.w / 2, -this.h / 2)
    this.img.draw(0, 0)

    ctx.restore()
  }
}
